import React from 'react';
import { formatPrice } from '../helpers';

class Order extends React.Component {

  render() {
    return (
      <li>
        <div className="order-wrap">
          <p>{this.props.qty}</p>
          <p>{this.props.name}</p>
          <p>{formatPrice(this.props.price * this.props.qty)}</p>
        </div>
      </li>
    );
  }
};

export default Order;
